import {BrowserRouter as Router, 
	Switch,
	Route,
	Link 
	} from "react-router-dom";
import './App.css';

function App() {
	return (
		<Router>
		<div className='App'>
			<nav>	
				<ul>
				 	<li><Link to="/"> Hello there </Link> </li>

				</ul>
			</nav>
			<Switch>
				<Route path="/">
					<Home />
				</Route>
			</Switch>
		</div>
		</Router>
	);
}

function Home(){
	return <h2>Home</h2>;
}

export default App;
